import React from 'react';
import { Card ,Col,Row} from 'react-bootstrap';

function Footer(props) {
    return (
        <footer>
            <Card className='shadow-lg'>
                <h2>
                    THE GENERICS
                </h2>
                <Card.Footer>
                    <Row display="flex">
                        <Col flat color="dark" className="p-2">
                           
                        </Col>
                        <Col flat color="dark" className="mx-3 p-2"></Col>
                            
                        
                        <Col flat color="dark" className="p-2"></Col>
                            
                    </Row>
                </Card.Footer>

            </Card>
        </footer>
    );
}

export default Footer;
